  }
  return null;
};
  return (
    <S.Component>
    <div className='body'>
   <Link to={'/'} ><div  onClick={loader} className='Home_button'>Hangjj-gamble</div></Link>
    <div className='List'>
      <div>사다리</div>
      <div>그래프</div>
      <div>룰렛</div>       
      </div>
    </div>
    </S.Component>
  )
}

